import { MenuIcon, XIcon } from "@heroicons/react/outline";

const navbar = () => {
  return (
    <div className="w-screen h-[80px] z-10 bg-zinc-100">
      <MenuIcon className="w-5" />
    </div>
  );
};

export default navbar;
